DROP TABLE IF EXISTS `account`;

create table account
(
    accountId         int auto_increment
        primary key,
    accountPhone      varchar(10)                         null,
    accountPassword   varchar(100)                        null,
    accountEmail      varchar(100)                        null,
    accountNickname   varchar(50)                         null,
    accountLevel      int                                 null,
    accountState      int                                 null,
    accountAddress    varchar(100)                        null,
    accountName       varchar(100)                        null,
    accountBirthday   date                                null,
    accountCreatetime timestamp default CURRENT_TIMESTAMP null,
    accountUpdatetime timestamp default CURRENT_TIMESTAMP null,
    accountGender     int                                 null,
    accountPhoto      mediumblob                          null,
    accountIdoc       mediumblob                          null,
    accountIntro      text                                null,
    accountReport     int                                 null,
    accountBank       varchar(100)                        null,
    accountVerify     varchar(50)                         null
)
    comment '會員資料表';

INSERT INTO THA101G1.account (accountId, accountPhone, accountPassword, accountEmail, accountNickname, accountLevel, accountState, accountAddress, accountName, accountBirthday, accountCreatetime, accountUpdatetime, accountGender, accountPhoto, accountIdoc, accountIntro, accountReport, accountBank, accountVerify) VALUES (1, '0900000001', 'password1', 'email1@example.com', '懸壺去世33', 2, 1, '台北市中山區民權西路123號', 'John Doe', '1990-01-01', '2023-06-03 10:49:12', '2023-06-10 15:37:51', 1, , null, '我喜歡挑戰自己的身體極限，特別熱愛籃球和足球。運動讓我感到活力充沛，並且培養了我的團隊合作精神和領導能力。無論是在球場上或是健身房中，運動都是我生活中不可或缺的一部分。我相信運動的力量，它帶給我快樂、健康和無限的挑戰。讓我們一起享受運動的樂趣吧！', 0, null, 'r3Y6F7t9');
INSERT INTO THA101G1.account (accountId, accountPhone, accountPassword, accountEmail, accountNickname, accountLevel, accountState, accountAddress, accountName, accountBirthday, accountCreatetime, accountUpdatetime, accountGender, accountPhoto, accountIdoc, accountIntro, accountReport, accountBank, accountVerify) VALUES (2, '0900000002', 'password2', 'email2@example.com', '帥黑', 1, 1, '新北市板橋區民生路456號', 'Jane Smith', '1995-02-02', '2023-06-03 10:49:12', '2023-06-07 11:07:32', 1, , null, '大家好！運動是我的生活靈感源泉。無論是慢跑、游泳還是瑜伽，我都熱愛每一個汗水滴落的時刻。運動讓我保持健康、增強耐力，並在挑戰中成長。我喜歡與朋友一起打球、探索新的運動項目。讓我們一同享受運動的樂趣吧！', 0, '234567890123', '8G2h1E5r');
INSERT INTO THA101G1.account (accountId, accountPhone, accountPassword, accountEmail, accountNickname, accountLevel, accountState, accountAddress, accountName, accountBirthday, accountCreatetime, accountUpdatetime, accountGender, accountPhoto, accountIdoc, accountIntro, accountReport, accountBank, accountVerify) VALUES (3, '0900000003', 'password3', 'email3@example.com', '小墨', 2, 1, '桃園市中壢區中正路789號', 'Mike Johnson', '1988-03-03', '2023-06-03 10:49:12', '2023-06-03 10:49:12', 1, , null, '嗨！我是一個運動狂熱者，對於運動有著無限的熱愛和動力。我喜歡挑戰自己的身體極限，從長跑到登山，從滑雪到衝浪，我都樂在其中。運動讓我保持健康、塑造身材，同時也帶給我快樂和自信。和我一起探索運動的無窮可能吧！', 0, '345678901234', 'a7D4J9k6');
INSERT INTO THA101G1.account (accountId, accountPhone, accountPassword, accountEmail, accountNickname, accountLevel, accountState, accountAddress, accountName, accountBirthday, accountCreatetime, accountUpdatetime, accountGender, accountPhoto, accountIdoc, accountIntro, accountReport, accountBank, accountVerify) VALUES (4, '0900000004', 'password4', 'bullhead01@gmail.com', '斜瀏海', 3, 1, '台中市西屯區文心南路321號', 'Emily', '1992-04-04', '2023-06-07 13:11:07', '2023-06-07 13:11:07', 2, , null, '大家好！我是一個對運動充滿熱情的人。籃球、網球、高爾夫球，我都喜歡嘗試。透過運動，我培養了毅力和決心，並學會了克服困難。運動讓我身心健康，同時也擴展了我的社交圈子。讓我們一起在運動場上創造精彩的時刻！', 0, '456789012345', 'n5P2q8W4');
INSERT INTO THA101G1.account (accountId, accountPhone, accountPassword, accountEmail, accountNickname, accountLevel, accountState, accountAddress, accountName, accountBirthday, accountCreatetime, accountUpdatetime, accountGender, accountPhoto, accountIdoc, accountIntro, accountReport, accountBank, accountVerify) VALUES (5, '0900000005', 'password5', 'email5@example.com', '馬尾哥', 2, 1, '台南市安南區永華路654號', 'David Johnson', '1991-05-05', '2023-06-03 10:49:12', '2023-06-03 10:49:12', 1, , null, '嗨！運動對我而言是生活中不可或缺的一部分。跑步、騎自行車、登山都是我喜愛的運動項目。透過運動，我學會了堅持、努力和超越自己的能力。運動不僅讓我身體健康，也帶來了心靈上的平靜和放鬆。一起享受運動帶來的愉悅吧！', 0, '567890123456', 'b6M9x1C7');
INSERT INTO THA101G1.account (accountId, accountPhone, accountPassword, accountEmail, accountNickname, accountLevel, accountState, accountAddress, accountName, accountBirthday, accountCreatetime, accountUpdatetime, accountGender, accountPhoto, accountIdoc, accountIntro, accountReport, accountBank, accountVerify) VALUES (6, '0900000006', 'password6', 'email6@example.com', '石油王', 2, 0, '高雄市三民區建國北路987號', 'Sarah Wilson', '1994-06-06', '2023-06-03 10:49:12', '2023-06-03 10:49:12', 1, , null, '大家好！我是一個熱愛運動的人，尤其喜歡挑戰自己的極限。我喜歡參加馬拉松比賽，並且不斷努力提升自己的成績。運動讓我擁有了強健的身體和堅定的意志力，同時也培養了我的紀律和自律。一起奔跑吧，享受運動', 0, '678901234567', 'H2l3V9s6');
INSERT INTO THA101G1.account (accountId, accountPhone, accountPassword, accountEmail, accountNickname, accountLevel, accountState, accountAddress, accountName, accountBirthday, accountCreatetime, accountUpdatetime, accountGender, accountPhoto, accountIdoc, accountIntro, accountReport, accountBank, accountVerify) VALUES (7, '0900000007', 'password7', 'email7@example.com', '頭紗', 2, 1, '苗栗縣苗栗市中正路654號', 'Tom Thompson', '1993-07-07', '2023-06-03 10:49:12', '2023-06-03 10:49:12', 2, , null, '嗨！我是一個熱衷於運動的人，對於健身和體能訓練有著濃厚的興趣。舉重、健身操、有氧運動，我都樂在其中。透過運動，我不僅塑造了健康的體態，也增強了肌肉力量和耐力。運動讓我感到振奮和自信，無論是在健身房還是戶外運動場地，我總是充滿活力。讓我們一起追求健康和強壯！', 1, '789012345678', 'y4T7e1U8');
INSERT INTO THA101G1.account (accountId, accountPhone, accountPassword, accountEmail, accountNickname, accountLevel, accountState, accountAddress, accountName, accountBirthday, accountCreatetime, accountUpdatetime, accountGender, accountPhoto, accountIdoc, accountIntro, accountReport, accountBank, accountVerify) VALUES (8, '0900000008', 'password8', 'email8@example.com', '麥可喬登', 1, 1, '新竹縣竹北市光明路321號', 'Alice Parker', '1996-08-08', '2023-06-03 10:49:12', '2023-06-03 10:49:12', 1, , null, '大家好！我是一個對水上運動著迷的人。游泳、衝浪、划船是我最喜愛的活動。水中的自由和清涼讓我感到快樂和放鬆。透過水上運動，我鍛煉了全身肌肉，增強了平衡和協調能力。無論是在海灘還是游泳池，我總是享受與水的親密接觸。讓我們一起嬉戲在波濤之中！', 0, '890123456789', 'f6R9k3G2');
